import React from 'react'
import '../styles/Input.css'

const Input = props => {
    return(
        <div className='InputWrapper'>
            <input name='UserInput' className="UserInput" value={props.userInput} onChange={event => props.handleUserInputChange(event.target.value)} />
            <button className="CompileBinaryCodeButton" onClick={props.compileBinaryCode}>Compile</button>
            <p><em>Enter some text</em></p>
        </div>
    )
}

export default Input
